import { useState } from 'react'
import Guitar from './assets/guitar.png'

function Home (){
  const [count, setCount] = useState(0);

    return(
        <div className="Container w-full h-[90vh] md:flex items-center justify-center flex-col">
          <div className="top flex flex-col h-full w-full text-left px-[1rem] justify-center md:pt-[10vh] md:px-[10vw]">
            <p className="font font-Libre text-lg text-[#5FD068]">Hi! My name is</p>
            <h1 className="name text-5xl font-Libre max-w-[100px] font-bold md:max-w-[1000px] my-[1rem] text-[#F5DF99]">Jizan Diaz Villafuerte</h1>
            <p className="font font-Libre mt-4 max-w-[400px] md:max-w-[500px]">I'm a Front-End Developer specializing in HTML/CSS and Javascript. I am currently learning React JS which 
              I used to develop this simple but wonderful portfolio.
            </p>
          </div>
          <img src={Guitar} alt="" className="w-auto h-[75vh]"/>
        </div>
    );
}




export default Home;
